import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../components/assets/logo.png'; // Adjust the path based on your folder structure
import '../styles/Header.css';

function Header() {
  return (
    <header className="header">
      <div className="logo-title">
        <img src={logo} alt="Autonomy Labs Logo" className="logo" />
        <Link to="/" className="title">Autonomy Labs</Link>
      </div>
      <nav>
        <Link to="/research">Product</Link>
        <Link to="/products">Research</Link>
        <Link to="/safety">Safety</Link>
        <Link to="/company">Company</Link>
      </nav>
    </header>
  );
}

export default Header;
